Yes, I can write Terraform code.  Here's a simple example that creates an AWS S3 bucket with encryption enabled:

```terraform
terraform {
  required_providers {
    aws = {
      source  = "hashicorp/aws"
      version = "~> 5.0"
    }
  }

  required_version = ">= 1.3.0"
}

provider "aws" {
  region = "us-west-2" # Replace with your desired region
}

resource "aws_s3_bucket" "example" {
  bucket = "my-tf-test-bucket-unique" # Ensure this is globally unique
  acl    = "private"

  server_side_encryption_configuration {
    rule {
      apply_server_side_encryption_by_default {
        sse_algorithm = "AES256"
      }
    }
  }

  versioning {
    enabled = true # Enable versioning for data recovery
  }
}


output "bucket_arn" {
  value = aws_s3_bucket.example.arn
}
```

This code creates a private S3 bucket with server-side encryption and versioning enabled.  What would you like to build?  Perhaps you have a specific cloud provider or resource in mind?
